// src/components/GoogleAuth.js
import React, { useState, useEffect } from 'react';
import googleAuthService from '../services/googleAuthService';

const GoogleAuth = ({ onAuthSuccess }) => {
  const [isAuthenticating, setIsAuthenticating] = useState(false);
  const [authError, setAuthError] = useState(null);
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  useEffect(() => {
    // Check if already authenticated
    setIsAuthenticated(googleAuthService.isAuthenticated());

    // Handle OAuth callback
    const handleAuthCallback = async () => {
      const urlParams = new URLSearchParams(window.location.search);
      const code = urlParams.get('code');
      const error = urlParams.get('error');

      if (error) {
        setAuthError(`Authentication error: ${error}`);
        setIsAuthenticating(false);
        return;
      }

      if (code) {
        setIsAuthenticating(true);
        setAuthError(null);

        try {
          await googleAuthService.exchangeCodeForTokens(code);
          setIsAuthenticated(true);
          
          // Clean up URL
          window.history.replaceState({}, document.title, window.location.pathname);
          
          // Notify parent component
          if (onAuthSuccess) {
            onAuthSuccess();
          }
        } catch (error) {
          console.error('Error during authentication:', error);
          setAuthError(error.message || 'Authentication failed. Please try again.');
        } finally {
          setIsAuthenticating(false);
        }
      }
    };

    handleAuthCallback();
  }, [onAuthSuccess]);

  const handleSignIn = () => {
    setIsAuthenticating(true);
    setAuthError(null);
    
    try {
      const authUrl = googleAuthService.getAuthUrl();
      window.location.href = authUrl;
    } catch (error) {
      console.error('Error initiating sign in:', error);
      setAuthError('Failed to initiate sign in. Please try again.');
      setIsAuthenticating(false);
    }
  };

  const handleSignOut = () => {
    try {
      googleAuthService.signOut();
      setIsAuthenticated(false);
      setAuthError(null);
    } catch (error) {
      console.error('Error signing out:', error);
      setAuthError('Failed to sign out.');
    }
  };

  const handleRetry = () => {
    setAuthError(null);
    handleSignIn();
  };

  return (
    <div className="bg-white rounded-lg p-4 shadow-sm border border-gray-200">
      {/* Authentication Status */}
      <div className="flex items-center justify-between mb-3">
        <div className="flex items-center space-x-2">
          <div className={`w-2 h-2 rounded-full ${
            isAuthenticated ? 'bg-green-500' : 'bg-gray-400'
          }`}></div>
          <span className="text-sm font-medium text-gray-700">
            Google Sheets
          </span>
        </div>
        
        <span className={`text-xs px-2 py-1 rounded-full ${
          isAuthenticated 
            ? 'bg-green-100 text-green-700' 
            : 'bg-gray-100 text-gray-600'
        }`}>
          {isAuthenticated ? 'Đã kết nối' : 'Chưa kết nối'}
        </span>
      </div>

      {/* Error Message */}
      {authError && (
        <div className="mb-3 p-3 bg-red-50 border border-red-200 rounded-lg">
          <p className="text-sm text-red-600">{authError}</p>
          <button
            onClick={handleRetry}
            className="mt-2 text-xs text-red-600 hover:text-red-700 font-medium underline"
            disabled={isAuthenticating}
          >
            Thử lại
          </button>
        </div>
      )}

      {/* Action Buttons */}
      <div className="space-y-2">
        {!isAuthenticated ? (
          <button
            onClick={handleSignIn}
            disabled={isAuthenticating}
            className={`w-full py-2 px-4 rounded-lg font-medium text-sm transition-colors ${
              isAuthenticating
                ? 'bg-gray-100 text-gray-400 cursor-not-allowed'
                : 'bg-blue-600 text-white hover:bg-blue-700'
            }`}
          >
            {isAuthenticating ? (
              <div className="flex items-center justify-center space-x-2">
                <div className="w-4 h-4 border-2 border-white border-t-transparent rounded-full animate-spin"></div>
                <span>Đang kết nối...</span>
              </div>
            ) : (
              'Kết nối Google Sheets'
            )}
          </button>
        ) : (
          <div className="space-y-2">
            <p className="text-xs text-gray-600 text-center">
              Dữ liệu sẽ được đồng bộ với Google Sheets
            </p>
            <button
              onClick={handleSignOut}
              className="w-full py-2 px-4 rounded-lg font-medium text-sm bg-gray-100 text-gray-700 hover:bg-gray-200 transition-colors"
            >
              Ngắt kết nối
            </button>
          </div>
        )}
      </div>

      {/* Info Text */}
      <p className="text-xs text-gray-500 mt-3 text-center">
        {isAuthenticated 
          ? 'Tasks và sessions sẽ được lưu vào Google Sheets của bạn'
          : 'Kết nối để đồng bộ dữ liệu giữa các thiết bị'
        }
      </p>
    </div>
  );
};

export default GoogleAuth;
